import React from 'react';
import './Global.css';
import Card from './components/card';
import Pizza from './assets/img/Pizza.jpg';
import Heather from './components/header';
import Botao from './components/botao';

function App() {
  return (
    <div className="App">
      <Heather />
      <h1>Hello World</h1>
      <Card />
      <Card />
      <img src={Pizza} alt="foto da pizza"/>
      <Botao texto="Confirmar"/>
      <Botao texto="Excluir"/>
    </div>
  );
}

export default App;
